import React from "react";
import { useDispatch } from "react-redux";
import { display } from "../../module/updateHeader";
import { useEffect } from "react";
import { useSelector } from "react-redux";

const applications = [
    {
        applicant: {
            name: "Ricardo Cooper",
            email: "ricardo.cooper@example.com",
            imageUrl:
                "https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80",
        },
        date: "2020-01-07",
        dateFull: "January 7, 2020",
        stage: "Completed phone screening",
        href: "#",
    },
    {
        applicant: {
            name: "Kristen Ramos",
            email: "kristen.ramos@example.com",
            imageUrl:
                "https://images.unsplash.com/photo-1550525811-e5869dd03032?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80",
        },
        date: "2020-01-07",
        dateFull: "January 7, 2020",
        stage: "Completed phone screening",
        href: "#",
    },
    {
        applicant: {
            name: "Ted Fox",
            email: "ted.fox@example.com",
            imageUrl:
                "https://images.unsplash.com/photo-1500648767791-00dcc994a43e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80",
        },
        date: "2020-01-07",
        dateFull: "January 7, 2020",
        stage: "Completed phone screening",
        href: "#",
    },
];

const Cart = () => {
    const dispatch = useDispatch();
    const CartList = useSelector((state) => state.addCart);

    useEffect(() => {
        dispatch(
            display({
                menu: "Cart",
                name: "Hooray! We Have your supplements ready",
                title: "Your Cart",
            })
        );
    }, []);

    return (
        <section>
            <ul className="bg-white shadow overflow-hidden sm:rounded-md divide-y divide-gray-200">
                {CartList.map((cart) => (
                    <li key={cart.id}>
                        <div className="flex items-center px-4 py-4 sm:px-6 min-w-0 flex-1">
                            <div>
                                <img
                                    className="h-12 w-12"
                                    src={cart.url}
                                    alt=""
                                />
                            </div>
                            <div className="min-w-0 flex-1 px-4 md:grid md:grid-cols-2 md:gap-4">
                                <div>
                                    <p className="text-sm font-medium text-gray-900 truncate">
                                        {cart.name}
                                    </p>
                                    <p className="mt-2 flex items-center text-sm text-gray-500">
                                        USD ${cart.price}
                                    </p>
                                </div>
                                <div className="block">
                                    <div>
                                        <p className="text-sm text-gray-900">
                                            <span className="text-sm text-gray-900 font-bold">
                                                Name On Pouch:
                                            </span>{" "}
                                            {cart.customername}
                                        </p>
                                        <p className="mt-2 flex items-center text-sm text-gray-500">
                                            <span className="text-sm text-gray-900 font-bold">
                                                Allergies
                                            </span>
                                            {cart.allergies?cart.allergies:'None'}
                                        </p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </li>
                ))}
            </ul>
        </section>
    );
};

export default Cart;
